export const ListActionTypes = {
  blur: 'list:blur',
  focus: 'list:focus',
  keyDown: 'list:keyDown',
  itemClick: 'list:itemClick',
  itemHover: 'list:itemHover',
  itemsChange: 'list:itemsChange',
  textNavigation: 'list:textNavigation'
};
